// Updated Button.tsx with onClick handler

import React from 'react';

interface ButtonProps {
    label: string;
    primary?: boolean;
    onClick?: () => void; // Adding an optional onClick function that returns void
}

const Button: React.FC<ButtonProps> = ({ label, primary, onClick }) => {
    const className = primary ? 'button primary' : 'button';
    return <button className={className} onClick={onClick}>{label}</button>;
};

export default Button;
